		function ColorPick() {
		
			mytimeup = 0;
			myGameOver = 0;
		
		
			if (mytimeup == 1) {
				mytimeup = 0;
			}
		
			var colorSelectScreen = new lib.libSelect();
			colorSelectScreen.x = 0;
			colorSelectScreen.y = 0;
		
			var playerSelect = new lib.libPlayerSelect();
			playerSelect.x = 243.45;
			playerSelect.y = 328.15;
		
			var selectSign = new lib.libSelectSign();
			selectSign.x = 291.95;
			selectSign.y = 322.55;
		
			var myCategory = new createjs.Text(); // createjs היא מחלקה בtext
			myCategory.font = "22px Rubik";
			myCategory.lineWidth = 136.2;
			myCategory.textAlign = "center";
			myCategory.x = 975.3;
			myCategory.y = 24.3;
			if (mychoice == 1) {
				myCategory.text = "היסטוריה";
			} else if (mychoice == 2) {
				myCategory.text = "טבע";
			}
		
			var myInstruction = new lib.libInstructions();
			myInstruction.x = 0;
			myInstruction.y = 0;
			myInstruction.name = "myInstruction";
		
			stage.addChild(colorSelectScreen);
			stage.addChild(selectSign);
			stage.addChild(playerSelect);
			stage.addChild(myCategory);
			stage.addChild(myMuteSign);
		
			if (myMute == 1) {
				stage.getChildByName("myMuteSign").gotoAndStop(1);
			}
		
			window.addEventListener("keydown", keypress);
			function keypress(e) {
		
				//------------------------------------------> RIGHT
				if (e.keyCode == 39) {
					if (myMute == 0) {
						myMusic = createjs.Sound.play("ClickMenu");
					}
		
					if (colorPicker < 2) {
						colorPicker++;
					}
		
					if (colorPicker == 0) {
		
						selectSign.x = 291.95;
						selectSign.y = 322.55;
					} else if (colorPicker == 1) {
		
						selectSign.x = 476.4;
						selectSign.y = 322.55;
					} else if (colorPicker == 2) {
		
						selectSign.x = 663.95;
						selectSign.y = 322.55;
		
					}
		
				}
		
				//--------------------------------------------> LEFT
				if (e.keyCode == 37) {
					if (myMute == 0) {
						myMusic = createjs.Sound.play("ClickMenu");
					}
					if (colorPicker > 0) {
						colorPicker--;
					}
		
					if (colorPicker == 0) {
						selectSign.x = 291.95;
						selectSign.y = 322.55;
					} else if (colorPicker == 1) {
		
						selectSign.x = 476.4;
						selectSign.y = 322.55;
					} else if (colorPicker == 2) {
		
						selectSign.x = 663.95;
						selectSign.y = 322.55;
					}
		
				}
		
				if (e.keyCode == 32 && howToPlay == 0) {
					if (myMute == 0) {
						myMusic = createjs.Sound.play("ClickMenu");
						myMusic = createjs.Sound.play("CountDown");
					}
					stage.removeChild(myCategory);
					stage.removeChild(colorSelectScreen);
					stage.removeChild(selectSign);
					stage.removeChild(playerSelect);
					stage.removeChild(myMuteSign);
					window.removeEventListener("keydown", keypress);
					WatchingTheQ();
				}
		
				if (e.keyCode == 27 && howToPlay == 0) { //ESC ------------------> HOW TO PLAY
					if (myMute == 0) {
						myMusic = createjs.Sound.play("ClickMenu");
					}
					howToPlay++;
					stage.addChild(myInstruction);
					setTimeout(function () {
						if (myMute == 0) {
							myMusic = createjs.Sound.stop("GamesMusic");
						}
					}, 215);
				} else if (e.keyCode == 27 && howToPlay == 1) {
					if (myMute == 0) {
						myMusic = createjs.Sound.play("ClickMenu");
					}
					howToPlay = 0;
					stage.removeChild(myInstruction);
					if (myMute == 0) {
						myMusic = createjs.Sound.play("GamesMusic");
					}
				}
		
			}
		
		}
		
		
